import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PropTypes from "prop-types";
import { Card, Button, CardTitle, CardBody, CardText, Row, Col, Container } from 'reactstrap';

import Header from "../../components/header/header.jsx";
import HeaderBanner from "../../components/banner/banner.jsx";
import Footer from "../../components/footer/footer.jsx";
import img1 from '../../assets/images/img1.jpg';
import img2 from '../../assets/images/img2.jpg';
import img3 from '../../assets/images/img3.jpg';
import img4 from '../../assets/images/img4.jpg';
import img5 from '../../assets/images/img5.jpg';
import img6 from '../../assets/images/img6.jpg';

const Home = () => {
    return (
        <div id="main-wrapper">
            <Header />
            <div className="page-wrapper">
                <div className="container-fluid text-center">
                    <HeaderBanner />
                    <h1 className="title">Welcome to the Robotics Learning Hub!</h1>

                    <div className="intro-content">
                        <p>
                            Embark on a fascinating journey into the world of robotics with our comprehensive learning resources.
                            Whether you're a beginner or an enthusiast, our curated lessons and projects will guide you through the exciting realm of robotics programming.
                        </p>

                        <h2>Roadmap to Learning Robotics</h2>
                        <ol>
                            <li>
                                <h3>Introduction to Robotics</h3>
                                <p>Explore the basics of robotics, understanding its applications and significance in various industries.</p>
                                <img src={img2} alt="Introduction to Robotics" />
                            </li>
                            <li>
                            <div className="spacer ">
                                    <Container className="feature30">
                                        <Row>
                                            <Col lg="10"><img src={img6} className="rounded img-responsive" alt="wrappixel" /></Col>
                                            <Col lg="6" md="9" className="text-center wrap-feature30-box">
                                                <Card className="card-shadow">
                                                    
                                                    <CardBody>
                                                        <div className="p-30">
                                                            <span className="label label-info label-rounded">Programming with ROS</span>
                                                            <h3 className="title">Master the Robot Operating System (ROS) to program and control robots. Dive into hands-on lessons and practical examples.</h3>
                                                            <p>Experience a care-free environment to try your hand at programming in Python!</p>
                                                            <a className="btn btn-info-gradiant btn-md btn-arrow m-t-20" href="/Lesson1"><span>Explore More <i className="ti-arrow-right"></i></span></a>
                                                        </div>
                                                    </CardBody>
                                                </Card>
                                            </Col>
                                        </Row>
                                    </Container>
                                </div>
                                <h3>Advanced Robotics Concepts</h3>
                                <p>Delve into advanced topics such as robot localization, mapping, and control algorithms to elevate your robotics skills.</p>
                                <img src={img3} alt="Advanced Robotics Concepts" />
                            </li>
                        </ol>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

Home.propTypes = {
    classes: PropTypes.object
};

export default Home;
